import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Home from './components/pages/Home'
import './components/styles/'

function App() {

    return (

        //Rotas

        <Router>
            <Routes>
                <Route path='/' element={<Home />} />
            </Routes>
        </Router>
    );
}

export default App;
